import './App.css';
// Or import all of React and use React.Component

function Counter(increase, decrease, count){
    return (
        <div className="App">
            <p>{count}</p>
            <button onClick={decrease}>-</button>
            <button onClick={increase}>+</button>
        </div>
    );
}

export default Counter;
